    return (
      <form onSubmit={this.submit}>
        <div>
          <label>Name</label>
          <input onChange={this.changeName} value={this.state.name}></input>
        </div>
        <div>
          <label>Age</label>
          <input onChange={this.changeAge} value={this.state.age}></input>
